import React, { useState, useEffect } from 'react';
import Navbar from "./components/navbar";
import HomeHero from "./components/HomeHero";
import MarketplaceSquares from "./components/MarketplaceSquares"; // Import the MarketplaceSquares component

function Home(props) {
  const [cargoListings, setCargoListings] = useState([]);

  useEffect(() => {
    fetch('https://api.example.com/cargo-listings')
      .then((response) => response.json())
      .then((data) => {
        console.log(data); // Log the data to verify it's correct
        setCargoListings(data);
      })
      .catch((error) => {
        console.error('Error fetching cargo listings:', error);
      });
  }, []);


  return (
    <div>
      <Navbar />
      <HomeHero cargoListings={cargoListings} /> {/* Pass cargo listings to HomeHero */}
      <MarketplaceSquares cargoListings={cargoListings} />
    </div>
  );
}

export default Home;
